import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './LandingPage.css';

function LandingPage() {
  // Örnek semboller (hisse/kripto)
  const [symbols] = useState(['IBM', 'AAPL', 'BTCUSD', 'ETHUSD']);
  const [marketData, setMarketData] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  // Alpha Vantage API Key (kendi API anahtarınızı girin)
  const ALPHAVANTAGE_API_KEY = 'YOUR_ALPHA_VANTAGE_API_KEY';

  useEffect(() => {
    async function fetchMarketData() {
      const results = [];

      for (let sym of symbols) {
        try {
          const url = `https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol=${sym}&apikey=${ALPHAVANTAGE_API_KEY}`;
          const response = await axios.get(url);
          const quote = response.data['Global Quote'];
          if (quote) {
            const symbolName = quote['01. symbol'] || sym;
            const price = quote['05. price'];
            let changePercent = quote['10. change percent'];
            if (changePercent) {
              // "%" işaretini kaldırıp, sayısal değeri alıp, iki ondalık basamağa yuvarla, sonra "%" ekle.
              const numericChange = parseFloat(changePercent.replace('%', ''));
              changePercent = numericChange.toFixed(2) + '%';
            } else {
              changePercent = 'N/A';
            }

            results.push({
              symbol: symbolName,
              price: price ? parseFloat(price).toFixed(2) : 'N/A',
              change: changePercent
            });
          } else {
            results.push({
              symbol: sym,
              price: 'N/A',
              change: 'N/A'
            });
          }
        } catch (err) {
          console.error('API Hatası:', err);
          results.push({
            symbol: sym,
            price: 'N/A',
            change: 'N/A'
          });
        }
      }
      setMarketData(results);
    }

    fetchMarketData();
  }, [symbols, ALPHAVANTAGE_API_KEY]);

  // Arama filtresi
  const filteredData = marketData.filter((item) =>
    item.symbol.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="landing-container">
      {/* Üst Kısım (Header / Navbar) */}
      <header className="landing-header">
        <div className="logo-area">
          <h2 className="logo-text">Finansal Analiz</h2>
        </div>
        <nav className="navbar">
          <ul>
            <li><a href="#features">Özellikler</a></li>
            <li><a href="#technology">Teknolojiler</a></li>
            <li><a href="#about">Hakkımızda</a></li>
            <li><a href="#contact">İletişim</a></li>
            <li><a href="/Login">Giriş Yap</a></li>
            <li><a href="/Register">Kayıt Ol</a></li>
          </ul>
        </nav>
      </header>

      {/* Hero Bölümü */}
      <section className="hero-section">
        {/* Sol Kısım: Başlık, Açıklama, Buton */}
        <div className="hero-content">
          <h1 className="hero-title">
            Bitirme Projesi: Finansal Analiz Uygulaması
          </h1>
          <p className="hero-subtitle">
            Gelir-gider takibi, bütçe yönetimi ve yatırım önerileri tek platformda.
            Makine öğrenmesi destekli analizlerle daha bilinçli finansal kararlar alın!
          </p>
          <button className="cta-button">Hemen Başla</button>
        </div>

        {/* Sağ Kısım: Piyasalar Bölümü (Gerçek Zamanlı) */}
        <aside className="markets-sidebar">
          <h3>Piyasalar (Alpha Vantage)</h3>
          {/* Arama Kutusu */}
          <div className="search-bar">
            <input
              type="text"
              placeholder="Sembol Ara..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </div>
          {/* Filtrelenmiş Piyasaları Listele */}
          <ul className="market-list">
            {filteredData.map((item, index) => (
              <li key={index} className="market-item">
                <span className="market-name">{item.symbol}</span>
                <span className="market-price">{item.price}</span>
                <span className="market-change">{item.change}</span>
              </li>
            ))}
          </ul>
        </aside>
      </section>

      {/* Diğer Bölümler (Özellikler, Teknolojiler, Hakkımızda, Footer) */}
      {/* ... (Önceki kodunuzun kalan kısmı burada yer alacak) */}
    </div>
  );
}

export default LandingPage;
